import React from 'react';
import { useNavigate } from 'react-router-dom';
import './WeightSelection.css'; // Import your styles

function WeightSelection() {
  const navigate = useNavigate();

  const handleWeightSelect = (weight) => {
    console.log(`Selected weight: ${weight}`);
    // Add your logic for handling weight selection here
  };

  return (
    <div className="weight-selection-container">
      <h1 className="weight-title">Select Your Weight</h1>

      <div className="weight-buttons">
        <button className="weight-button" onClick={() => handleWeightSelect('50 kg')}>
          50 kg
        </button>
        <button className="weight-button" onClick={() => handleWeightSelect('60 kg')}>
          60 kg
        </button>
        <button className="weight-button" onClick={() => handleWeightSelect('70 kg')}>
          70 kg
        </button>
        <button className="weight-button" onClick={() => handleWeightSelect('80 kg')}>
          80 kg
        </button>
      </div>
    </div>
  );
}

export default WeightSelection;
